  false,\n\t\"url\": null,\n\t\"notes\": \"This map is one of a series of four 1:25,000-scale
  quadrangle maps (Anchorage C-8 NE Quadrangle) intended to provide information on
  the geology and construction materials along the southern margin of the Talkeetna
